  false,\n\t\"url\": null,\n\t\"notes\": \"Benthic organism and other data were collected
  from grab casts in the Gulf of Alaska from NOAA Ship DISCOVERER by the University
  of Alaska - Fairbanks; Institute of Marine Science (UAK/IMS). Data were collected
  as part of the Outer Continental Shelf Environmental Assessment Program (OCSEAP)
  from 08 October 1975 to 16 October 1975. Data were processed by NODC to the NODC
  standard F132 Benthic Organism format. Full format description is available from
  NODC at www.nodc.noaa.gov/General/NODC-Archive/f132.html. An analog file for this
  accession is available from NODC user services.nnThe F132 format contains data from
  field sampling or surveys of bottom dwelling marine organisms. The data provide
  information on species abundance, distribution, and biomass; they may have been
  collected by point sampling (grab or core), by tow (dredge, trawl or net), by photographic
  surveys, or by other methods. Cruise information such as vessel, start and end dates,
  investigator, and institution/agency; station numbers, positions and times; and
  equipment and methods are reported for each survey. Environmental data reported
  at each sampling site may include meteorological and sea surface conditions; surface
  and bottom temperature, salinity and dissolved oxygen; and sediment characteristics.
  Number of individual organisms and total weight of organisms is reported for each
  species. A text record is available for comments.\",\n\t\"license_title\": null,\n\t\"extras\":
